import React from "react";

const Card = ({ project }) => {
  return (
    <div className="card">
      <strong>2023</strong>
      <h2>{project.title}</h2>
      <p>{project.description}</p>
      <br />

      <div className="tabs flex">
        <a href={project.url} className="link" target="_blank">
          Demo ↗️
        </a>

        <a href={project.source} className="link" target="_blank">
          Source ↗️
        </a>

        <a href={project.articleLink} className="link" target="_blank">
          Article
        </a>
      </div>
    </div>
  );
};

export default Card;
